  \"usgs-us-topo-acquisition-plan-objectives-for-fy15-from-the-national-map\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"U.S. Geological Survey, Department of the
  Interior - The annual US Topo acquisition plan is to collect topographic map data
  in the form of US Topo GeoPDF maps over the United States and its territories on
  a 3-year revision cycle. The FY17 acquisition plan currently anticipates production
  of 18,500 (or more) US Topo maps this year. Interested parties who wish to become
  a data acquisition partner with the USGS in FY17 or in future years should contact
  a USGS Geospatial Liaison - http://liaisons.usgs.gov/geospatial/documents/TNM_Partnership_User_ContactList.pdf.\",\n\t\"license_title\":
